import React from 'react';

export default function Footer() {
  return (
    <footer className='footer'>
        <form>
            <input type="email" name="email" id="" placeholder='Enter your email' />
            <button type="submit">Subscrib</button>
        </form>
        <section className='foot'></section>
    </footer>
  );
}
